START TRANSACTION;
CREATE TABLE IF NOT EXISTS `NEO_SYSTEM_PROJECT_SETTINGS` (
	`Guid`	VARCHAR(255) NOT NULL,
	`Version`	VARCHAR(255),
	PRIMARY KEY(`Guid`)
);
CREATE TABLE IF NOT EXISTS `NEO_SYSTEM_TABLE_VERSIONS` (
	`StorageTableName`	VARCHAR(255) NOT NULL,
	`GuidString`	VARCHAR(255),
	`SchemaVersion`	bigint,
	`DataVersionDesignTime`	bigint,
	`DataVersionRunTime`	bigint,
	PRIMARY KEY(`StorageTableName`)
);
CREATE TABLE IF NOT EXISTS `PowerOff` (
	`Id`	INT,
	`Time`	datetime,
	PRIMARY KEY(`Id`)
);
CREATE TABLE IF NOT EXISTS `DataLogger2` (
	`Id`	INT,
	`Time`	datetime,
	`Datapicker1`	VARCHAR(255),
	`Datapicker2`	VARCHAR(255),
	PRIMARY KEY(`Id`)
);
CREATE TABLE IF NOT EXISTS `DataLogger3` (
	`Id`	INT,
	`Time`	datetime,
	`LoadingTime`	int,
	`UnloadingTime`	int,
	PRIMARY KEY(`Id`)
);
CREATE TABLE IF NOT EXISTS `AlarmServer` (
	`Text`	VARCHAR(255),
	`DynamicValues`	VARCHAR(255),
	`Id`	VARCHAR(255) NOT NULL,
	`AlarmEventType`	VARCHAR(255),
	`AlarmItemName`	VARCHAR(255),
	`AlarmItemDisplayName`	VARCHAR(255),
	`State`	VARCHAR(50),
	`Count`	int,
	`AcknowledgeTime`	datetime,
	`InActiveTime`	datetime,
	`NormalTime`	datetime,
	`ActiveTime`	datetime,
	PRIMARY KEY(`Id`)
);
CREATE TABLE IF NOT EXISTS `DataLogger1` (
	`Id`	INT,
	`Time`	datetime,
	`Latitud`	VARCHAR(255),
	`Longitud`	VARCHAR(255),
	`Dosis_proa_babor`	smallint,
	`UVT_proa_babor`	smallint,
	`Flujo_proa_babor`	smallint,
	`Dosis_proa_estribor`	smallint,
	`UVT_proa_estribor`	smallint,
	`Flujo_proa_estribor`	smallint,
	`Dosis_popa_babor`	smallint,
	`UVT_popa_babor`	smallint,
	`Flujo_popa_babor`	smallint,
	`Dosis_popa_estribor`	smallint,
	`UVT_popa_estribor`	smallint,
	`Flujo_popa_estribor`	smallint,
	`O2_proa_babor`	real,
	`T_proa_babor`	real,
	`O2_centro_babor`	smallint,
	`T_centro_babor`	smallint,
	`O2_popa_babor`	real,
	`T_popa_babor`	real,
	`O2_proa_estribor`	real,
	`T_proa_estribor`	real,
	`O2_centro_estribor`	smallint,
	`T_centro_estribor`	smallint,
	`O2_popa_estribor`	real,
	`T_popa_estribor`	real,
	`pH_babor`	real,
	`pH_estribor`	real,
	`Co2_babor`	float,
	`Co2_estribor`	float,
	`wb_closed_ps`	smallint,
	`wb_closed_sb`	smallint,
	PRIMARY KEY(`Id`)
);
CREATE INDEX `Idx_PowerOff_Time` ON `PowerOff` (
	`Time`	ASC
);
CREATE INDEX `Idx_DataLogger2_Time` ON `DataLogger2` (
	`Time`	ASC
);
CREATE INDEX `Idx_DataLogger3_Time` ON `DataLogger3` (
	`Time`	ASC
);
CREATE INDEX `Idx_AlarmServer_ActiveTime` ON `AlarmServer` (
	`ActiveTime`	DESC
);
CREATE INDEX `Idx_DataLogger1_Time` ON `DataLogger1` (
	`Time`	ASC
);
COMMIT;
